(105,	'2022-12-28 22:07:26.826331+00',	'2022-12-28 22:07:26.826331+00',	'["A log of executed queries, used for calculating historic execution times, auditing, and other purposes.","An action is something you can do, such as run a readwrite query","An http api call type of action","A readwrite query type of action","Cached results of queries are stored here when using the DB-based query cache.","Collections are an optional way to organize Cards and handle permissions for them.","Confirmed payments from Piespace’s customers. Most accounts pay for their pie subscription on a monthly basis.","Confirmed Sample Company orders for a product, from a user.","Defines top level concerns for App","Events table","Includes a catalog of all the products ever sold by the famed Sample Company.","Information on customer accounts registered with Piespace. Each account represents a new organization signing up for on-demand pies.","Information on the user accounts registered with Sample Company.","Information (such as average execution time) for different queries that have been previously ran.","Keeps track of various logins for different users and additional info such as location and device","Piespace does some anonymous analytics tracking on how users interact with their platform. They’ve only had time to implement a few events, but you know how it is. Pies come first.","Presence of a row here indicates a given User has favorited a given Dashboard.","Query snippets (raw text) to be substituted in native queries","Records that a given Card (Question) should automatically replace a given Table as query source for a given a Perms Group.","Reviews (from moderators) for a given question/dashboard (BUCM)","Reviews that Sample Company customers have left on our products.","Storage for managed secrets (passwords, binary data, etc.)","Stores references to alternate views of existing fields, such as remapping an integer to a description, like an enum","Stores results of async computation jobs."